import React from 'react'

export default function ConnectMethod() {

    const HOW_TO_CONNECT = {
        facebook:{
            name:"Facebook",
            method:"www.facebook.com"
        },
        instagram:{
            name:"Instagram",
            method:"www.instagram.com"
        },
        google:{
            name:"Google",
            method:"www.google.com"
        },

    }

    const buttonsToConnect = Object.keys(HOW_TO_CONNECT).map(e=>{
        const info = HOW_TO_CONNECT[e]
        return(<button><a href={info.method}>{info.name}</a></button>)
    })
    return (
        <div>
                {buttonsToConnect}
        </div>
    )
}
